import("stdfaust.lib");
sig = 0.2 * os.osc(freq) * gain * gate with {
  freq = hslider("freq", 440, 40, 8000, 1);
  gain = hslider("gain", 0.5, 0, 1, 0.01);
  gate = button("gate") : en.adsr(0.01, 0.1, 0.9, 0.5);
};
process = sig, sig;
effect = dm.freeverb_demo;

